package com.home.commonClient.net.request.login;
import com.home.commonClient.constlist.generate.GameRequestType;
import com.home.commonClient.net.base.GameRequest;
import com.home.shine.bytes.BytesWriteStream;
import com.home.shine.control.BytesControl;

/** 玩家主动下线(generated by shine) */
public class PlayerExitRequest extends GameRequest
{
	/** 数据类型ID */
	public static final int dataID=GameRequestType.PlayerExit;
	
	public PlayerExitRequest()
	{
		_dataID=GameRequestType.PlayerExit;
		setDontCache();
	}
	
	@Override
	protected void copyData()
	{
		super.copyData();
	}
	
	/** 获取数据类名 */
	@Override
	public String getDataClassName()
	{
		return "PlayerExitRequest";
	}
	
	/** 写入字节流(完整版) */
	@Override
	protected void toWriteBytesFull(BytesWriteStream stream)
	{
		super.toWriteBytesFull(stream);
		
		stream.startWriteObj();
		
		stream.endWriteObj();
	}
	
	/** 创建实例 */
	public static PlayerExitRequest create()
	{
		PlayerExitRequest re=(PlayerExitRequest)BytesControl.createRequest(dataID);
		return re;
	}
	
}
